package json

import "time"

type SmallPayload struct {
	A         int64
	B         int32
	C         string
	D         uint32
	E         string
	F         int
	Message   string
	CreatedAt time.Time
}

type MediumPayload struct {
	SmallPayloadA SmallPayload
	SmallPayloadB SmallPayload
	SmallPayloadC *SmallPayload
	SmallPayloadD *SmallPayload
	SmallPayloadE []SmallPayload
	Message       string
	CreatedAt     time.Time
}

type LargePayload struct {
	SmallPayloadA  SmallPayload
	MediumPayloadB MediumPayload
	SmallPayloadC  *SmallPayload
	MediumPayloadD *MediumPayload
	MediumPayloadE []MediumPayload
	MediumPayloadF []MediumPayload
	MediumPayloadG []*MediumPayload
	Message        string
	CreatedAt      time.Time
}

func NewSmallPayload() *SmallPayload {
	return &SmallPayload{
		A:         1,
		B:         2,
		C:         "Keep coding, Keep growing",
		D:         4,
		E:         "I Love Golang",
		F:         6,
		Message:   "Planx is equal to Planxnx",
		CreatedAt: time.Now(),
	}
}

func NewMediumPayload() *MediumPayload {
	SmallPayloadE := make([]SmallPayload, 10)
	for i := 0; i < len(SmallPayloadE); i++ {
		SmallPayloadE[i] = *NewSmallPayload()
	}
	return &MediumPayload{
		SmallPayloadA: *NewSmallPayload(),
		SmallPayloadB: *NewSmallPayload(),
		SmallPayloadC: NewSmallPayload(),
		SmallPayloadD: NewSmallPayload(),
		SmallPayloadE: SmallPayloadE,
		Message:       "Planx is not Plan X",
		CreatedAt:     time.Now(),
	}
}

func NewLargePayload() *LargePayload {
	MediumPayloadE := make([]MediumPayload, 100)
	for i := 0; i < len(MediumPayloadE); i++ {
		MediumPayloadE[i] = *NewMediumPayload()
	}
	MediumPayloadF := make([]MediumPayload, 100)
	for i := 0; i < len(MediumPayloadF); i++ {
		MediumPayloadF[i] = *NewMediumPayload()
	}
	MediumPayloadG := make([]*MediumPayload, 100)
	for i := 0; i < len(MediumPayloadF); i++ {
		MediumPayloadG[i] = NewMediumPayload()
	}

	return &LargePayload{
		SmallPayloadA:  *NewSmallPayload(),
		MediumPayloadB: *NewMediumPayload(),
		SmallPayloadC:  NewSmallPayload(),
		MediumPayloadD: NewMediumPayload(),
		MediumPayloadE: MediumPayloadE,
		MediumPayloadF: MediumPayloadF,
		MediumPayloadG: MediumPayloadG,
		Message:        "Planx is pronounced like Bank or Prank but Planx",
		CreatedAt:      time.Now(),
	}
}

